import React from "react";
import { Text, Input} from "../elements";

const Login = (props) => {
  return (
    <React.Fragment>
        <Text size="32px" bold>로그인</Text>
        <Input label="아이디" placeholder ="아이디를 입력해주세요."/>
        <Input label="패스워드" placeholder ="패스워드를 입력해주세요."/>
        <button></button>

    </React.Fragment>
  );
};

export default Login;
